import React, { useState } from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
  const [isOpen, setIsOpen] = useState(false);

  const toggleMenu = () => {
    setIsOpen(!isOpen);
  };

  const closeMenu = () => {
    if (isOpen) {
      setIsOpen(false);
    }
  };

  return (
    <div className="relative">
      {/* First Navbar section with logo, contact info, and tagline */}
      <nav className="bg-custom-palmhouse border-gray-200">
        <div className="flex flex-wrap justify-between items-center mx-auto max-w-screen-xl p-4">
          {/* Logo */}
          <a href="/" className="flex items-center space-x-3 rtl:space-x-reverse">
            <img
              src={`${process.env.PUBLIC_URL}/Photos/Dstar_logo.png`}
              alt="Dstar Logo"
              className="ml-10 h-20 w-60 scale-125 transition-transform duration-300 hover:scale-135"
            />
          </a>

          {/* Tagline */}
          <div className="hidden md:block text-xl text-gray-900 font-semibold animate-fade-in">
            <p className="italic">"Where learning meets excellence"</p>
          </div>

          {/* Contact Info */}
          <div className="flex items-center space-x-6 rtl:space-x-reverse">
            <a href="tel:+6597436961" className="flex items-center text-sm text-gray-700 hover:text-black transition-all duration-300">
              <span className="font-semibold">(+65) 9743 6961</span>
            </a>
            <a href="mailto:dstar.jw@gmail.com" className="flex items-center text-sm text-gray-700 hover:text-black transition-all duration-300">
              <span className="font-semibold">dstar.jw@gmail.com</span>
            </a>
          </div>
        </div>
      </nav>

      {/* Second Navbar section with navigation links */}
      <nav className="bg-custom-white shadow-md">
        <div className="max-w-screen-xl px-4 py-3 mx-auto flex justify-between items-center">
          {/* Mobile Menu Button */}
          <div className="md:hidden">
            <button onClick={toggleMenu} className="text-gray-900 focus:outline-none transition-transform duration-300 hover:rotate-180">
              <svg
                className="w-6 h-6"
                fill="none"
                stroke="currentColor"
                viewBox="0 0 24 24"
                xmlns="http://www.w3.org/2000/svg"
              >
                <path
                  strokeLinecap="round"
                  strokeLinejoin="round"
                  strokeWidth="2"
                  d={isOpen ? "M6 18L18 6M6 6l12 12" : "M4 6h16M4 12h16m-7 6h7"}
                ></path>
              </svg>
            </button>
          </div>

          {/* Navigation Links */}
          <div className={`md:flex md:items-center ${isOpen ? 'block' : 'hidden'} w-full md:w-auto transition-opacity duration-300`}>
            <ul className="flex flex-col md:flex-row font-medium mt-4 md:mt-0 space-y-2 md:space-y-0 md:space-x-8 text-sm">
              {['Home', 'About Us', 'Programs', 'Gallery', 'Join Us', 'Book a Tour', 'Registration', 'Fees', 'News'].map((link, index) => (
                <li key={index}>
                  <Link to={`/${link.replace(/\s+/g, '-').toLowerCase()}`} className="text-gray-900 hover:text-custom-blue transition duration-300 ease-in-out" onClick={closeMenu}>
                    {link}
                  </Link>
                </li>
              ))}
            </ul>
          </div>
        </div>
      </nav>

      {/* Popout menu for smaller screens */}
      {isOpen && (
        <div className="fixed top-0 left-0 w-2/3 h-full bg-gray-50 shadow-lg z-50 transform transition-transform duration-300 ease-in-out overflow-y-auto">
          <button onClick={toggleMenu} className="absolute top-4 right-4 text-gray-900 focus:outline-none">
            <svg
              className="w-6 h-6"
              fill="none"
              stroke="currentColor"
              viewBox="0 0 24 24"
              xmlns="http://www.w3.org/2000/svg"
            >
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M6 18L18 6M6 6l12 12"></path>
            </svg>
          </button>
          <ul className="flex flex-col items-start mt-20 space-y-8 p-4">
            {['Home', 'About Us', 'Programs', 'Gallery', 'Join Us', 'Book a Tour', 'Registration', 'Fees', 'News'].map((link, index) => (
              <li key={index}>
                <Link to={`/${link.replace(/\s+/g, '-').toLowerCase()}`} className="text-gray-900 dark:text-white hover:underline transition-all duration-300" onClick={toggleMenu}>
                  {link}
                </Link>
              </li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
}

export default Navbar;
